text:
@coustes gerard 1116
tantot chez l'auteur de ses vidéos j'adopte leurs pensées
mais revet chez moi souvent entrelacée
ses images jeune et frais ornement;
tantot je ne retiens que les mots seulement;
j'en détourne le sens et l'art sait les containdre
vers des objets nouveaux qu'ils s'étonnent par des clips et chansons magnifiques magiques sens esthétique grace mélancolique et de beauté sculpturale  belles réussites maintes lieux communs que ce soit amour tristesse ou aspiration à la vie paisible ou tourmentée une technique sans égale un jeu ardent inspiration moderne ou antique de chez eux bravo
